  let path = "/dialogs/" + props.id;

  return (
    <ul className={s.item}>
      <li>
        <NavLink activeClassName={s.active} to={path}>
          {props.name}
        </NavLink>
      </li>
    </ul>
  );
};

const Message = (props) => {
  return <div className="message_item">{props.say}</div>;
};

const Dialogs = (props) => {

  let d = {
    id: 1,
    name: 'Gluk'
  };
  let a = {
    id: 2,
    name: ''
  };


  return (
    <div className={s.dialogs}>
      <div className={s.dialogs_item}>
        <h1> Dialogs</h1>
        <DialogItem name="gluk1" id="1" />
        <DialogItem name="gluk2" id="2" />
        <DialogItem name="gluk3" id="3" />
        <DialogItem name="gluk4" id="4" />
        <DialogItem name="gluk5" id="5" />
      </div>
      <div className={s.messages}>
        <Message say="hi" />
        <Message say="how is your name" />
        <Message say="what are you doing" />
      </div>
    </div>
  );
};

